import './App.css';
import {Button, Col, Form, FormControl, FormGroup, Row} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
      <div className="App">
        <div className="Content">
          <p>Enter a url to shorten</p>
          <Form className='half'>
              <Form.Control id="inlineFormInputName" placeholder="Jane Doe" />
              <Button type="submit" className="btn-lg">Submit</Button>
          </Form>
          <a
              className="Link"
              href="#"
              target="_blank"
              rel="noopener noreferrer"
          >
            https://smlr.org/yourlink
          </a>
        </div>
      </div>
  );
}

export default App;
